			// click事件
			realInputClickEvent: function(){
				var me = this;
				me.hideFace();
				// android非微信浏览器会有输入法盖住input现象
	//			me.container.style.height = '1000px'; 
				me.div2.scrollIntoView();
				me.realInput.focus();
				
			},
